import React from "react";
import {SearchFilter as SearchFilterType} from "../types/searchFilters.type";
import {FilterType} from "./filterType.component";
import {ChangeFilter} from "../types/methods.type";
import { FilterValue } from "./filterValue.components";
import {DeleteFilter} from "./deleteFilter.component";
import { FormControl } from "@mui/material";

export function SearchFilter({searchFilter, changeFilter}:{searchFilter:SearchFilterType, changeFilter:ChangeFilter}) {
    const {filterType,filterValue} = searchFilter;
    return <div>
        <FormControl variant="standard" sx={{ m: 1, minWidth: 150, maxWidth: 150}}>
        <FilterType filterType={filterType} changeFilterType={(newType:string|null)=>changeFilter(newType,'')}/>
        <FilterValue filterType={filterType} filterValue={filterValue} changeFilterValue={(newValue:string)=>changeFilter(filterType,newValue)}/>
        <DeleteFilter/>
        </FormControl>
    </div>;
}
